const Navbar = () => {
    return (
        <div style={{display: 'flex', alignItems: 'center', justifyContent: 'center'}}>
            <p>Copyright &copy; <strong>Golam Mostafa</strong>. Github: <a href="https://github.com/golammostafa13/" target="_blank">golammostafa13</a></p>
        </div>
    );
};

export default Navbar;
